package uniquechars;

import org.junit.Assert;

public class CharUtilTest {

    private static String[] strings4UniqueChars = {
            "qqwer",
            "qqqqqqqqqqqqqqqqwer",
            "qqwerrrrrrrrrrrrrrr",
            "qqweeeeeeeer",
            "qwerq",
            "qqwrqqe",
            "qwer",
            "rewq",
            "qwerqwerwqerqwerwqerweqrqwerq",
            "qwerwerqweqrweqrq",
            "werwerwqerwerq",
            "qwerwqerwerwer",
            "qwerwerwerwerqq",
            "qwerwerwwerwerwerewrqwerqwerqwerqwerwqerwqerwqerwqerwqerwqerwqerwqerwqerwqerwqerqwerwerqq",
            "qwer",
            "qwereewrwer",
            "qwerwer",
    };

    private static String[] strings9UniqueChars = {
            "asdfgasadfasdfasdfasdfhjk6",
            "19238471928347129384712938462139846921834821347982134982137492183642163512983749",
            "191919282828281918282737367465654656567567478382382818119218348123418925",
            "191919191919191919919191919191991919191919919191123456789",
            "1234556789",
            "1234556789",
            "9887654321",
            "1123456789",
            "1234567899",
    };

    private String bigString10UniqueChars = "";

    private String bigString26UniqueChars = "";


    @org.junit.Test
    public void testGetUniqueCharsOfStringCorrectness() throws Exception {

        // Test method for correctness

        for (String str : strings4UniqueChars) {

            Assert.assertTrue("This line = " + str,
                    CharUtil.getUniqueCharsOfString(str).length() == 4);

        }

        for (String str : strings9UniqueChars) {

            Assert.assertTrue("This line = " + str,
                    CharUtil.getUniqueCharsOfString(str).length() == 9);

        }

    }

    @org.junit.Test
    public void testGetUniqueCharsOfStringBigData() throws Exception {

        // Test method with big data

        Assert.assertTrue("bigString10UniqueChars - wrong",
                CharUtil.getUniqueCharsOfString(bigString10UniqueChars).length() == 10);

        Assert.assertTrue("bigString26UniqueChars - wrong",
                CharUtil.getUniqueCharsOfString(bigString26UniqueChars).length() == 26);

    }

    @org.junit.Test
    public void testGetUniqueCharsOfStringCompareWithBruteForce() throws Exception {

        // Simple compare speed of two methods on 26 Unique Chars data

        long startTime = System.currentTimeMillis();
        int uniqueCharsCount = -1;

        for (int i = 0; i < 5000; i++) {
            uniqueCharsCount = CharUtil.getUniqueCharsOfString(bigString26UniqueChars).length();
        }
        System.out.println("getUniqueCharsOfString time is = " + (System.currentTimeMillis() - startTime) + ", uniqueCharsCount = " + uniqueCharsCount);

        startTime = System.currentTimeMillis();
        for (int i = 0; i < 5000; i++) {
            uniqueCharsCount = CharUtil.getUniqueCharsOfStringBruteForce(bigString26UniqueChars).length();
        }
        System.out.println("getUniqueCharsOfStringBruteForce time is = " + (System.currentTimeMillis() - startTime) + ", uniqueCharsCount = " + uniqueCharsCount);

    }

}